import React from 'react';


function Romantic() {
    return (
        <div>
            <h1>Your style type is Romantic. </h1>
            <img alt="" src="https://www.proprofs.com/api/ckeditor_images/New%20Project%20(25)(27).jpg" />
            <h3 className='resultDescr'>You gravitate toward wardrobe essentials that will always be Romantic.</h3>
        </div>
    );
};



export default Romantic;
